// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.0 <8.10.0;

contract Test{
    struct Bid{
        uint deposit;
        bytes32 secretBid;
    }


    uint public auctionEnd;
    uint public discloseEnd;
    address internal beneficiary;
    uint public highestPrice;
    address public highester;


    mapping(address=>uint) returnPrice;
    mapping(address=>Bid[]) bids;

    event auctionEndEvent(address _s, uint amount);

    modifier onlyBefore(uint timeEnd){require(timeEnd < block.timestamp);_;}
    modifier onlyAfter(uint timeEnd){require(timeEnd > block.timestamp);_;}

    constructor(address _beneficiary, uint _auctionEnd, uint _discloseEnd) {
        beneficiary = _beneficiary;
        auctionEnd = block.timestamp + _auctionEnd;
        discloseEnd = auctionEnd + _discloseEnd;
    }

    function bid(bytes32 _secretBid) payable public onlyBefore(auctionEnd) {
        bids[msg.sender].push(
            Bid({
            deposit: msg.value,
            secretBid: _secretBid
        })
        );
    }

    function disclose(uint[] memory _value, bool[] memory _fake, bytes32[] memory _secret) public onlyAfter(auctionEnd) onlyBefore(discloseEnd) {
        uint length = bids[msg.sender].length;
        require(_value.length == length);
        require(_fake.length == length);
        require(_secret.length == length);
        uint refund = 0;
        for (uint i = 0; i < length; i++) {
            Bid storage bidNew = bids[msg.sender][i];
            (uint value, bool fake, bytes32 secret) = (_value[i], _fake[i], _secret[i]);
            bytes memory v = abi.encodePacked(value, fake, secret);
            if (bidNew.secretBid != keccak256(v)){
               continue;
            }
            refund += bidNew.deposit;
            if (!fake&&bidNew.deposit >= value){
                // 找出是否是最大的单子
                if (placeBid(value,msg.sender)) {
                    refund -= value;
                }
            }
            bidNew.secretBid = bytes32(0); // 这一单无法再退款
        }
        payable(msg.sender).transfer(refund);
    }

    function placeBid(uint _amount, address _sender) internal returns(bool) {
        if (_amount <= highestPrice) {
            return false;
        }

        if (highester != address(0)) {
            returnPrice[highester] += highestPrice;
        }

        highester = _sender;
        highestPrice = _amount;
        return true;
    }

    function withDraw() public {
        uint amount = returnPrice[msg.sender];
        if (amount>0) {
            payable(msg.sender).transfer(amount);
        }
    }
}

